const flname = "react app";
let currdate = new date().toLocalDateString();
let currtime = new time().toLocalTimeString();
ReactDOM.render(
  <>
    <h1> hello {flname}!!!</h1>
    <h2>{`My first name is ${flname}. Sum of 44 and 55 is ${44 + 55}`}</h2>
    <p>lorem ipsome {5 + 6}</p>
    <h3>System Date And Time</h3>
    <p>Today's Date is = ${currdate}</p>
    <p>Current Time is = ${currtime}</p>
  </>, // react.fragment's syntactic sugar form

  document.getElementById("root")
);
